import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import MapContainer from '../components/MapContainer';
import { useGeoLocation } from '../hooks/useGeoLocation'
import './Tab1.css';


const Tab1: React.FC = () => {
  const { position } = useGeoLocation()

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Hackatkon 2</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Hackatkon 2</IonTitle>
          </IonToolbar>
        </IonHeader>
        <MapContainer name="Tab 1 - Position" position={position} />
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
